import React, { useState } from 'react'
import './sidebar.css'


function SideBar() {
    const [isOpen, setIsOpen] = useState(true);

  return (
    <div className={`sidebar ${isOpen ? 'open' : 'closed'}`}>
        <button onClick={()=> setIsOpen(!isOpen)} className='toggle'>
            {isOpen?'<':'>'}
        </button>

    </div>
  )
}

export default SideBar
